def Add(a, b):
        print(a + b)
def AddList(a):
        s = 0
        for i in a:
                s = s + i
        print(s)
def Substract(a, b):
        print(a - b)
def Multiply(a, b):
        print(a * b)
def divide(a, b):
        if b == 0:
                print("Error: Divide by zero")
        else:
                print(a / b)
